import React from 'react';

export const Login = () => {
    return (
        <div className='min-h-screen flex items-center justify-center'>
            <div className='bg-white flex'>
                <div className='w-1/2'>
                    <h2>Login</h2>
                </div>
            </div>
        </div>
    );
};
